import './Character.css';

import Characters from '../db/Character/Character';

function Character({Characters}) {
  const characterList = Characters.map((Characters, i) => {
    return <Characters key={i} id={Characters[i].id} name={Characters[i].name}/> 
  })
  return (
    <div>
      <p>Character</p>
      
      <div>{characterList}</div>
    </div>
   

  
  );
}

export default Character;
